import React, { Component } from "react";

export default class Node extends Component {
    render() {
        const nodeStyle = {
            height: "50px",
            width: "50px",
            gridColumnStart: this.props.start,
            gridColumnEnd: this.props.end,
        
            backgroundColor: "#fff",
            borderRadius: "50%",
            border: "2px solid red",
        
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
        }
        
        return (
            <div style={nodeStyle}>
                {this.props.value}
            </div>
        );
    }
}
